//Versi√≥n datatable y ajax.
$(document).ready(function() {
    //Mostrar campos de la tabla Proyecto.
    $('#Proyecto').DataTable({
        "ajax": url + "Proyectos/MostrarProyecto",
        "order": [],
        "language": idioma_espanol,
        dom: 'Bfrtip',
        "buttons": [{
            extend: 'pdfHtml5',
            text: 'PDF',
            titleAttr: 'Exportar PDF',
            filename: 'Reporte_Proyectos_pdf',
            orientation: 'landscape',
            pageSize: 'A4',
            customize: function(doc) {
                //Remover el titulo por defecto
                doc.content.splice(0, 1);
                //Obtener la fecha
                var now = new Date();
                var fecha = now.getDate() + '-' + (now.getMonth() + 1) + '-' + now.getFullYear();

                var logo = 'data:image/png;base64,';

                doc.pageMargins = [20, 60, 20, 30];
                // Tama√≥ de la fuente del documento
                doc.defaultStyle.fontSize = 12;
                // Tama√±o de la fuente header
                doc.styles.tableHeader.fontSize = 12;
                // Header
                doc['header'] = (function() {
                    return {
                        columns: [{
                                alignment: 'left',
                                image: logo,
                                width: 32
                            },
                            {
                                alignment: 'Middle',
                                bold: true,
                                text: 'Universidad Salvadore√±a Alberto Masferrer',
                                fontSize: 18,
                                margin: [10, 0]
                            },
                            {
                                alignment: 'right',
                                fontSize: 14,
                                bold: true,
                                text: 'Reporte Proyectos'
                            }
                        ],
                        margin: 20
                    }
                });
                // Pie de P√°gina
                doc['footer'] = (function(page, pages) {
                    return {
                        columns: [{
                                alignment: 'left',
                                text: ['Fecha Creaci√≥n: ', { text: fecha.toString() }]
                            },
                            {
                                alignment: 'right',
                                text: ['p√°gina ', { text: page.toString() }, ' de ', { text: pages.toString() }]
                            }
                        ],
                        margin: 10
                    }
                });
                // Margenes personalizados
                var objLayout = {};
                objLayout['hLineWidth'] = function(i) { return .5; };
                objLayout['vLineWidth'] = function(i) { return .5; };
                objLayout['hLineColor'] = function(i) { return '#000'; };
                objLayout['vLineColor'] = function(i) { return '#000'; };
                objLayout['paddingLeft'] = function(i) { return 4; };
                objLayout['paddingRight'] = function(i) { return 4; };
                doc.content[0].layout = objLayout;
            }
        }, 'copy', 'csv', 'excel']
    });

});

function limpiarAlumno() {

 
    $('#CrearProyecto').trigger("reset");
    var validator = $("#CrearProyecto").validate();
    validator.resetForm();
    $('.form-control').removeClass('is-valid is-invalid');
    $('.custom-select').removeClass('is-valid is-invalid');
    infoAlumnosLimpiar();

}


// Acci√≥n de Insertar Proyecto.
$(function() {
    $("#CrearProyecto").submit(function(event) {
        $(this).find('.nav-pills a:first').tab('show');
        $.ajax({
            url: url + 'Proyectos/Guardar',
            data: $("#CrearProyecto").serialize(),
            type: "post",
            async: false,
            dataType: 'json',
            success: function(data) {

                if (data !== '') {

                    Swal.fire({
                        position: 'top-end',
                        icon: 'success',
                        title: 'Datos guardados correctamente',
                        showConfirmButton: false,
                        timer: 1500
                    })

                    $('#CrearProyecto')[0].reset();
                    limpiarAlumno()
                } else {
                    alert('ingrese datos');
                }
            },
            error: function() {
                Swal.fire({
                    icon: 'error',
                    title: 'Oops...',
                    text: 'Algunos campos son requeridos!'
                })
            }
        });
        event.preventDefault();
    });

});

/****************************************************************************
                        VALIDACIONES PROYECTO
****************************************************************************/
//efecto en los input de la case needs-validation
jQuery.validator.setDefaults({
    debug: true,
    success: "valid",
    onfocusout: function(e) {
        this.element(e);
    },
    onkeyup: false,

    highlight: function(element) {
        jQuery(element).closest('.form-control').addClass('is-invalid');
        jQuery(element).closest('.custom-select').addClass('is-invalid');
    },
    unhighlight: function(element) {
        jQuery(element).closest('.form-control').removeClass('is-invalid');
        jQuery(element).closest('.form-control').addClass('is-valid');
        jQuery(element).closest('.custom-select').removeClass('is-invalid');
        jQuery(element).closest('.custom-select').addClass('is-valid');
    },

    errorElement: 'div',
    errorClass: 'invalid-feedback',
    errorPlacement: function(error, element) {
        if (element.parent('.input-group-prepend').length) {
            $(element).siblings(".invalid-feedback").append(error);
            //error.insertAfter(element.parent());
        } else {
            error.insertAfter(element);
        }
    }
});

